льзовать готовый бизнес. \r\nКомплекс введен в эксплуатацию с 2006 года. Земля находится в долгосрочной аренде на 49 лет, договор аренды обновлен в 2008 году. Помещения находятся в частной собственности.\r\n\"\r\n',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,3,'',0,NULL,750000,1,235,NULL,NULL,NULL,NULL,NULL,NULL,'1',NULL,3,'kommercheskaya-nedvizhimost-evpatoriya-dmitra-ulyanova',0,NULL,NULL,0,NULL,0,5,NULL,'',45.1951,33.3683,NULL,NULL,'2014-06-25 16:59:02','2014-06-25 17:46:38','/uploads/advert/pdf/309/309.pdf',1),(310,'Дома-Ялта-Пер.Сосновый',1,4,1,44000,453,19932000,NULL,NULL,16,NULL,30519,'7',NULL,1,NULL,NULL,'f62d8890-deb7-0131-721d-5404a61a95c1.JPG','f62d8bc0-deb7-0131-7702-5404a61a95c1.jpg',NULL,'\"Продажа жилого дома.Крым.Ялта.Без комиссии.                                                                                                                                                                  - две городские ветки канализации;\r\n- две ветки подвода воды;\r\n- два газовых котла (один -  для нагрева проточной воды и отопления дома и второй – для подогрева бассейна);\r\n-централизованное электроснабжение 380 Вольт;\r\n- американская система очистки и смягчения воды;\r\n- система автоматического поддержания давления воды в системе;\r\n- отопление: теплые полы;\r\n- система «Умный дом»;\r\n- система телекоммуникаций: высокоскоростной Интернет, цифровое кабельное ТВ, телефон;\r\n- бассейн с подогревом и противотоком.\r\n Планировка.\r\n     Дом состоит из двух этажей и подвального помещения.\r\n1) В подвальном помещении находится сауна-парная с комнатой отдыха, душевой кабиной и санузлом; хозяйственное помещение. \r\n2) На 1 этаже находится зона гостиной, совмещенная с зоной кухни и столовой, спальня с санузлом и гардеробной.\r\n3) На 2 этаже находится холл с подвесным камином, две спальни с санузлами и гардеробными.\r\n4) Балкон-терасса №1.\r\n5) Балкон-терасса №2 со спортивными тренажерами.\r\n6) Зимний сад.\r\nДизайн.\r\nВнутренняя планировка и дизайн дома выполнен в стиле модерн.\r\n- Мебель дизайнерская мировых производителей: Baxter, Giorgetti, SNAIDERO, Creazioni. \r\n- Отделочные материалы итальянских брендов: Fornasetti.\r\n- Раздвижная система окон и дверей.\r\n- Паркет из натурального венги.\r\n- Подоконники из натурального оникса и белого мрамора.\r\n- Освещение дома  мировых производителей.\r\n- Сантехника дизайнерская итальянских производителей, гидромассажная ванна на 2 персоны.\r\n- Плазменные телевизоры Pioneer, проектор, аудиосистема.\r\n- Оригинальная отделка фасада дома.\r\n   Участок.\r\n- Ландшафтный дизайн с экзотическими растениями.\r\n- Зона отдыха в районе бассейна: терраса, дизайнерское барбекю в стеклянной мозаике, качеля-кровать с балдахином из африканского дерева абаш.\r\n- Наружное освещение IGUZZINI.\r\n- Видеонаблюдение периметра участка.\r\n- Отделка террасы и дорожек на участке – мрамор и травертин.\r\n\"\r\n',NULL,NULL,NULL,0,0,NULL,4,NULL,NULL,0,'',0,NULL,2491500,1,235,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,3,'doma-yalta-persosnovyi',0,NULL,NULL,0,NULL,0,5,NULL,'',44.4839,34.1445,NULL,NULL,'2014-06-25 16:59:13','2014-06-25 17:46:38','/uploads/advert/pdf/310/310.pdf',1),(311,'Коммерческая недвижимость-Киев-Большая Житомирская ул',2,1,0,279,102,28458,NULL,NULL,2,3,30061,'17',NULL,1,NULL,NULL,'fc0e0030-deb7-0131-c174-5404a61a95c1.JPG',NULL,'','Аренда офиса 102 м2. Шевченковский р-н.Бизнес Центр. Без комиссии. Ул.Б.Житомирская. Админ здание. Отдельный офис 102 м2. Большой кабинет с панорамным окном, миникухня. Возможно разделение кабинета.Интернет,телефония,приточно-отточная вентиляция. Юр.адресс. Офисный свежий ремонт. Неж.фонд. Цена 279гр.\\м2 нал или 333гр.\\м2 безнал с НДС + свет и отопление. Свой офис без комиссии. Долгосрочная аренда.    ',NULL,NULL,'',0,NULL,NULL,NULL,NULL,NULL,3,'',0,NULL,33966,2,370,NULL,NULL,NULL,NULL,NULL,NULL,'1',NULL,3,'kommercheskaya-nedvizhimost-kiev-bolshaya-zhitomirskaya-ul--10',0,'2012-03-23','2014-12-28',0,NULL,1,2,NULL,'',50.4551,30.5136,NULL,NULL,'2014